import React, { useState, useEffect } from 'react';
import {
    Button,
    Grid,
    IconButton,
    Drawer
} from '@mui/material';
import MenuIcon from '@mui/icons-material/Menu';
import CloseIcon from '@mui/icons-material/Close';
import logo from '../../assets/logo1.png';
import message from '../../assets/contact.png';
import { Link } from 'react-scroll';

const Navbar = () => {
    const [mobileOpen, setMobileOpen] = useState(false);
    const [isMobile, setIsMobile] = useState(window.innerWidth < 900);

    const links = [
        { label: "Home", to: "home" },
        { label: "About", to: "about" },
        { label: "Experience", to: "Experience" },
        { label: "Projects", to: "Projects" },
    ];

    // Update isMobile state on window resize
    useEffect(() => {
        const handleResize = () => {
            const mobile = window.innerWidth < 900;
            setIsMobile(mobile);

            // Auto-close drawer if switching to desktop
            if (!mobile && mobileOpen) {
                setMobileOpen(false);
            }
        };

        window.addEventListener("resize", handleResize);
        return () => window.removeEventListener("resize", handleResize);
    }, [mobileOpen]);

    return (
        <div style={{ background: "rgb(30,30,30)", color: "white", position: 'sticky', top: 0, zIndex: 1300 }}>
            <Grid
                container
                alignItems="center"
                justifyContent="space-between"
                style={{
                    paddingTop: '20px',
                    paddingBottom: '20px',
                    paddingLeft: isMobile ? '10px' : '70px',
                    paddingRight: isMobile ? '10px' : '70px'
                }}
            >

                {/* Logo */}
                <Grid item xs={6} md={2}>
                    <img src={logo} alt="logo" style={{ height: '80px', cursor: 'pointer' }} />
                </Grid>

                {/* Desktop Nav Links */}
                {!isMobile && (
                    <Grid
                        item
                        md={7}
                        style={{
                            display: 'flex',
                            justifyContent: 'center',
                            gap: '24px'
                        }}
                    >
                        {links.map((link) => (
                            <Button
                                key={link.to}
                                style={{
                                    color: 'white',
                                    textTransform: 'none',
                                    fontWeight: 'bold',
                                    fontSize: 'large',
                                    position: 'relative',
                                    background: 'transparent',
                                    borderBottom: '3px solid transparent',
                                }}
                                onMouseEnter={(e) => {
                                    e.target.style.borderBottom = '3px solid yellow';
                                }}
                                onMouseLeave={(e) => {
                                    e.target.style.borderBottom = '3px solid transparent';
                                }}
                            >
                                <Link to={link.to} smooth={true} duration={500}>
                                    {link.label}
                                </Link>
                            </Button>
                        ))}
                    </Grid>
                )}

                {/* Desktop Contact Button */}
                {!isMobile && (
                    <Grid
                        item
                        md={3}
                        style={{
                            display: 'flex',
                            justifyContent: 'flex-end'
                        }}
                    >
                        <Button
                            variant="contained"
                            style={{
                                background: 'white',
                                color: 'black',
                                fontWeight: 'bold',
                                display: 'flex',
                                alignItems: 'center',
                                gap: '12px',
                                textTransform: 'none',
                                padding: '6px 16px',
                            }}
                        >
                            <img src={message} alt="message icon" style={{ width: 20, height: 20 }} />
                            Contact Me
                        </Button>
                    </Grid>
                )}

                {/* Mobile Menu Icon */}
                {isMobile && (
                    <Grid
                        item
                        xs={6}
                        style={{
                            display: 'flex',
                            justifyContent: 'flex-end'
                        }}
                    >
                        <IconButton
                            onClick={() => setMobileOpen(true)}
                            style={{ color: "white" }}
                        >
                            <MenuIcon />
                        </IconButton>
                    </Grid>
                )}
            </Grid>

            {/* Mobile Drawer */}
            <Drawer
                anchor="right"
                open={mobileOpen}
                onClose={() => setMobileOpen(false)}
                ModalProps={{ keepMounted: true }}
                PaperProps={{
                    style: {
                        width: 250,
                        backgroundColor: "rgb(30,30,30)",
                        color: "white",
                        padding: '16px',
                        boxSizing: 'border-box',
                    }
                }}
            >
                {/* Close Icon */}
                <div style={{ display: 'flex', justifyContent: 'flex-end', marginBottom: '10px' }}>
                    <IconButton
                        onClick={() => setMobileOpen(false)}
                        style={{ color: "white" }}
                    >
                        <CloseIcon />
                    </IconButton>
                </div>

                {/* Mobile Nav Links */}
                {links.map((link) => (
                    <Button
                        key={link.to}
                        onClick={() => setMobileOpen(false)}
                        style={{
                            color: 'white',
                            textTransform: 'none',
                            fontWeight: 'bold',
                            width: '100%',
                            justifyContent: 'flex-start',
                            padding: '10px 16px'
                        }}
                    >
                        <Link to={link.to} smooth={true} duration={500}>
                            {link.label}
                        </Link>
                    </Button>
                ))}

                <Button
                    variant="contained"
                    style={{
                        background: 'white',
                        color: 'black',
                        fontWeight: 'bold',
                        display: 'flex',
                        alignItems: 'center',
                        gap: '12px',
                        textTransform: 'none',
                        padding: '6px 16px',
                        width: "100%",
                        marginTop: '16px'
                    }}
                >
                    <img src={message} alt="message icon" style={{ width: 20, height: 20 }} />
                    Contact Now
                </Button>
            </Drawer>
        </div>
    );
};

export default Navbar;
